import React from 'react'
import './Section.css'
import { IphoneGraphicBlock } from './IphoneGraphicBlock.jsx'
import { WebGraphicBlock } from './WebGraphicBlock.jsx'

export const Section = (props) => {
  const leftGraphicBlock =
    props.leftGraphicBlock == 'iphone' ? (
      <IphoneGraphicBlock image={props.leftIcon} />
    ) : props.leftGraphicBlock == 'web' ? (
      <WebGraphicBlock image={props.leftIcon} />
    ) : null
  const rightGraphicBlock =
    props.leftGraphicBlock == 'iphone' ? (
      <IphoneGraphicBlock image={props.leftIcon} />
    ) : props.leftGraphicBlock == 'web' ? (
      <WebGraphicBlock image={props.leftIcon} />
    ) : null

  const textBlock =
    props.textBlockType == 'h1' ? (
      <h1>{props.text}</h1>
    ) : props.leftGraphicBlock == 'h2' ? (
      <h2>{props.text}</h2>
    ) : props.leftGraphicBlock == 'h3' ? (
      <h3>{props.text}</h3>
    ) : props.leftGraphicBlock == 'h4' ? (
      <h4>{props.text}</h4>
    ) : props.leftGraphicBlock == 'h5' ? (
      <h5>{props.text}</h5>
    ) : null
  const textBlockStyle = {
    width: props.textWidth,
  }
  return (
    <section>
      <div className="left-graphic-block">{leftGraphicBlock}</div>
      <div className="left-indicator-block"></div>
      <div
        style={textBlockStyle}
        className={'text-block' + ' ' + props.textType}
      >
        {props.text}
      </div>
      <div className="right-indicator-block"></div>
      <div className="right-graphic-block">{rightGraphicBlock}</div>
    </section>
  )
}
